import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import UploadLink from "./components/UploadLink";
import Chatbot from "./components/Chatbot";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/upload-link">
            <UploadLink />
          </Route>
          <Route path="/chatbot">
            <Chatbot />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
